@dmi3k I find it only just "ok" - the following code is just plain ugly:

mtcars |&gt; 
   (\(x) lm(mpg ~ disp, data = x))() 

Although I don't mind the PIPEBIND version:

mtcars |&gt; 
   . =&gt; lm(mpg ~ disp, data = .)

But they both just seem like "%&gt;%" with extra steps.

